import './App.css';

function Header(props) {
  return (
    <header>
	  <h1>Main Heading Is Here {props.name}</h1>
    </header>
  );
}

function Body(props){
	return(
		<section>
			<h1>The Body will be Here</h1>
      <ul style={{ textAlign: "left" }}>
        {props.dishes.map(dish => (
          <li key={dish.id}>{dish.title}</li>
        ))}
      </ul>
		</section>
	);
}

function Footer(props){
	return(
		<footer>
			<ul>
			 <li>Footer 1</li>
			<li>Footer 2</li>
			<li>Footer {props.year}</li>
			</ul>
		</footer>
	)
}

const dishes = [
	"Musa",
	"Tivo",
	"Kevin",
	"Steve"
];

const dishObjects = dishes.map((dish, i) => ({
  id: i,
  title: dish
}));

function App() {
  return (
    <div className="App">
	  <Header name="Tivo"/>
	  <Body dishes={dishes} />
	  <Footer year={new Date().getFullYear()}/>
    </div>
  );
}

export default App;
